        return localAuthority
                .map(localAuthority1 -> new ResponseEntity<>(localAuthority1.getOzwilloInstanceInfo().getDcId(), HttpStatus.OK))
                .orElseGet(() -> new ResponseEntity<>(HttpStatus.NOT_FOUND));
    }
